sys_variable_value.value:
(function execute(inputs, outputs) {
    if (inputs.status_code == '200' && inputs.response.indexOf(
            "These users can log into Jenkins") != -1) {
        outputs.status = "Success";
    } else {
        outputs = new JenkinsErrorHandler().userErrorHandler(inputs,
            outputs);
    }
})(inputs, outputs);

